script: |
  super -f text -I q10818.spq | sort > q10818.out

inputs:
  - name: q10818.spq
    data: |
      SELECT ALL + 28 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - 45 + col1 NOT BETWEEN - 3 AND - ( col0 ) * ( - 1 );
  - name: tab1

outputs:
  - name: q10818.out
    data: |
      28
      28
